const leer = (interacciones) => {
  let respuestas = {};
  let tiempo = 0;
  let corrects = 0;
  let tiempoIncorrecto = 0;
  let incorrects = 0;
  let postTimes = [];
  let postTimesProm = 0;
  for (let i = 0; i < interacciones.length(); i++) {
    if (interacciones[i]["correct"] == true) {
      tiempo += interacciones[i]["time"];
      corrects += 1;
    } else {
      tiempoIncorrecto += interacciones[i]["time"];
      incorrects += 1;
      if (i + 1 < interacciones.length()) {
        if (interacciones[i + 1]["correct"] != true) {
          let val = interacciones[i + 1]["time"] - interacciones[i]["time"];
          postTimes.append(val);
          postTimesProm += val;
        }
      }
    }
  }

  let mediaResponse = tiempo / corrects;
  let mediaIncorrect = tiempoIncorrecto / incorrects;
  let postTimesProm2 = postTimesProm / (incorrects - 1);

  let valStandard = 0;
  let postTimesStandard = 0;

  for (let i = 0; i < interacciones.length(); i++) {
    if (interacciones[i]["correct"] == true) {
      valStandard += abs(i["time"] - mediaResponse) ** 2;
    }
  }

  for (let i = 0; i < postTimes.length(); i++) {
    postTimesStandard += abs(i - postTimesProm2) ** 2;
  }

  valStandard = valStandard / corrects;
  valStandard = math.sqrt(valStandard);
  postTimesStandard = postTimesStandard / (incorrects - 1);
  postTimesStandard = math.sqrt(postTimesStandard);

  respuestas["a"] = valStandard;
  respuestas["b"] = mediaResponse;
  respuestas["c"] = incorrects;
  respuestas["d"] = mediaIncorrect;
  respuestas["e"] = postTimesStandard;

  print(respuestas);
  return respuestas;
};
